    CW += c[35]*45.061550; /*ch3choh */
    CW += c[36]*45.061550; /*ch3ch2o */
    CW += c[37]*28.013400; /*n2 */
    /*Now compute conversion */
    y[0] = c[0]*2.015940/CW; 
