    /*Compute mean molecular wt first */
    XW += x[0]*2.015940; /*h2 */
    XW += x[1]*1.007970; /*h */
    XW += x[2]*16.043030; /*ch4 */
    XW += x[3]*15.035060; /*ch3 */
    XW += x[4]*14.027090; /*ch2 */
