    nuki[ 14 * kd + 32 ] += +1 ;

    /*reaction 34: ch3 + ho2 <=> ch3o + oh */
    nuki[ 3 * kd + 33 ] += -1 ;
    nuki[ 13 * kd + 33 ] += -1 ;
    nuki[ 24 * kd + 33 ] += +1 ;
    nuki[ 12 * kd + 33 ] += +1 ;

    /*reaction 35: ch3 + ho2 <=> ch4 + o2 */
