    nuki[ 13 * kd + 34 ] += -1 ;
    nuki[ 2 * kd + 34 ] += +1 ;
    nuki[ 10 * kd + 34 ] += +1 ;

    /*reaction 36: ch3 + o <=> ch2o + h */
