    nuki[ 11 * kd + 35 ] += -1 ;
    nuki[ 6 * kd + 35 ] += +1 ;
    nuki[ 1 * kd + 35 ] += +1 ;

    /*reaction 37: ch3 + o2 <=> ch3o + o */
