    eqcon[4] *= 1e+06; 

    /*reaction 6: h + o2 (+h2) <=> ho2 (+h2) */
    eqcon[5] *= 1e+06; 

    /*reaction 7: h + o2 (+h2o) <=> ho2 (+h2o) */
